class Solution {
public:
    int maxOperations(string s) {
        int cnt = 0;
        int prefix = 0;
        int n = s.size();
        for(int i=0;i<n;i++){
            if(s[i]=='1')prefix++;
            else if(i>0 && s[i-1]=='1'){
                cnt+=prefix;
            }
        }
        return cnt;
    }
};
